const user = {
  name: 'Hedy Lamarr',
  imageUrl: 'https://i.imgur.com/yXOvdOSs.jpg',
  imageSize: 90,
};

function MyButton() {
  return (
    <button>
      我是一个按钮
    </button>
  );
}

function AdminPanel(){
  return (
    <div>
      AdminPanel
    </div>
  )
}

function LoginForm(){
  return(
    <div>
      LoginForm
    </div>
  )
}

export default function MyApp() {
  let content;
  return (
    <>
      <h1 className="avatar">欢迎来到{user.name}的应用</h1>
      <img
        className="avatar"
        src={user.imageUrl}
        alt={'Photo of ' + user.name}
        style={{
          width: user.imageSize,
          height: user.imageSize
        }}
      />
      <MyButton />
    </>
  );
  if(true){
    content=<AdminPanel/>
  }else{
    content=<LoginForm/>
  }

  return (
    <div>
      {content}
    </div>
  );
}
